import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import JobSubmission from './JobSubmission';
import ApplicationStatus from './ApplicationStatus';

function App() {
  return (
    <Router>
      <div className="App">
        <h1 style={{ textAlign: 'center' }}>Job Hunt Application</h1>
        <Switch>
          <Route exact path="/">
            <JobSubmission />
          </Route>
          <Route path="/status">
            <ApplicationStatus />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
